import SelectList from '../components/SelectList';

export default function Jobs()
{
	return (
		<div className="job-search">
			<SelectList
			title='Choose Location'
			options={[
				{text: "Abudhabi"},
				{text: "Fujairah"},
				{text: "Ajman"},
				{text: "Dubai"},
			]} />
		</div>
	);
};
